Short Description:
IAIR was founded in 1991 to provide an association to individuals involved with insurance receiverships in order to receive education, promote information exchange, and enhance the standards followed by those who work in this position.

IAIR Mission Statement 
(a) To establish a professional organization comprised of individuals who provide services associated with the affairs of insurers that are in receivership or otherwise financially troubled and in need of restructuring;

(b) To develop educational and training programs to enhance the qualifications of professionals working in the field of insurance company receiverships and restructurings and to provide a forum for discussion of ideas, experiences and subjects of common interest to them;

(c) To establish ethical and professional standards for professionals retained to conduct or advise in the affairs of insurers that are in receivership or otherwise financially troubled and in need of restructuring; and

(d) To recognize, through accreditation, the attainment by its members of expertise and proficiency in such pursuits.
